import React, { useEffect } from "react";
import { useState } from "react";

const ShowExams = () => {
  const [data, setData] = useState("");
  const [topicData,setTopicData]=useState([]);

  const deleteRows = (index) => {
    const updatedRows = [...data];
    updatedRows.splice(index, 1);
    setData(updatedRows);
    // fetch("https://localhost:8443/onlineexam/control/deleteexam", {
    //   method: "DELETE",
    // });
  };

 
  

  const examDetails= async (examId)=>{

    console.log("exam Details is called....");
    console.log(examId);
    const map={
      examId:examId
    }
    // const examId= examId;
    const response=await fetch("https://localhost:8443/onlineexam/control/getExamTopicEvent",{
      method: 'POST',
      credentials:"include",
      body: JSON.stringify(map),
      headers:{
        'Content-type' : 'application/json',
      },
    });
    const result=await response.json();
    // const text=JSON.stringify(result);
    // console.log(result.ExamDetails);
    const output = result.ExamDetails;
    setTopicData([...output]);
    // console.log(text);
    console.log("topic data...",result.ExamDetails);
    console.log("***********************************************")
    console.log("NAREN - MASTER")
console.log(output);
    console.log(topicData);

    return(
      <div className="container bg-dark">
          <div>
              <div className="col-3">
                
              </div>
          </div>
      </div>
    )
  }

  async function fetchInfo() {
    console.log("fetch obj is called....");

    const response = await fetch(
      "https://localhost:8443/onlineexam/control/examMasterListEvent"
    );

    const text = await response.json();
    console.log(text);
    setData(text.ExamData)
   
  }

  useEffect(() => {
    fetchInfo();
  }, []);

  return (
    <div className="container">
      <div className="col-8 ">
        <table className="table table-striped ">
          <thead>
            <tr>
               <th>ExamId</th> 
              <th>ExamName</th>
              {/* <th>CreationDate</th>
              <th>ExpirationDate</th>
              <th>No of Questions</th>
              <th>Duration Minutes</th>
              <th>Pass Percentage</th>
              <th>Questions Randomized</th>
              <th>Negative Mark value</th> */}
              <th></th>
              <th></th>
              <th></th>
              <th></th>
              
            </tr>
          </thead>

          <tbody>
            {data ? data.map((obj, value) => (
                  <tr>
                    <td>{obj.examId}</td> 
                    <td>{obj.examName}</td>
                     <td>{obj.description}</td> 
                    {/* <td>{obj.creationDate}</td>
                    <td>{obj.expirationFate}</td>
                    <td>{obj.noOfQuestions}</td>
                    <td>{obj.durationMinutes}</td>
                    <td>{obj.passPercentage}</td> */}
                    {/* <td>{obj.questionsRandomized}</td> */}
                    {/* <td>{obj.answersMust}</td> */}

                    {/* <td>{obj.enableNegativeMark}</td> */}
                    {/* <td>{obj.negativeMarkValue}</td> */}
                    <td>
                      <button className="btn btn-primary">Edit</button>
                    </td>
                     <td>
                      <button className="btn btn-primary" onClick={()=>{examDetails(obj.examId)}}>Details</button>
                      {/* <button className="btn btn-primary" onClick={examDetails(obj.examId)}>Details</button> */}
                    </td> 
              
                    <td>
                      <button
                        className="btn btn-danger"
                        onClick={() => deleteRows(value)}
                      >
                        Delete
                      </button>
                    </td>
                  </tr>
                ))
              : ""}
          </tbody>
        </table>
      </div>
      {topicData ? topicData.map((obj,value)=>{
                  return(
                    <table>
                      
                        <thead>
                          <tr>
                          <th>Topic ID</th>
                          <th>Questions Per Exam</th>
                          <th>Percentage</th>
                          <th>Exam ID</th>
                          <th>Topic Pass Percentage</th>
                          </tr>
                        </thead>
                      <tbody>
                        <tr key={value}>
                        <td>{obj.topicId}</td>
                        <td>{obj.questionsPerExam}</td>
                        <td>{obj.percentage}</td>
                        <td>{obj.examId}</td>
                        <td>{obj.topicPassPercentage}</td>
                        </tr>
                      </tbody>
                      </table>
                )}):<>No data</>}
    </div>
  );
};
export default ShowExams;
